import React, { Component } from 'react'

export default class Home extends Component {
    render() {
        return (
            <div style={{marginTop:'400px'}}>
                <img src="/images/channeling.png" width="110" height="110" className="d-inline-block align-top" alt=""/>
                <img src="/images/patientinfo.png" width="110" height="110" className="d-inline-block align-top" alt=""/>
                <img src="/images/payment.png" width="110" height="110" className="d-inline-block align-top" alt=""/>
                <img src="/images/surgery.png" width="110" height="110" className="d-inline-block align-top" alt=""/>
                <img src="/images/pharmacy.png" width="110" height="110" className="d-inline-block align-top" alt=""/>
                <img src="/images/services.png" width="110" height="110" className="d-inline-block align-top" alt=""/>
            </div>
        )
    }
}
